import React from "react";

export const Logo = () => {
    return (
        <Box
            sx={{
                fontFamily: "monospace",
                fontWeight: 700,
                letterSpacing: ".3rem",
                color: "inherit",
                textDecoration: "none",
            }}
        >
            HOTEL.APP
        </Box>
    );
};
